# ==================== ENCRYPTION ====================
def encrypt_json(data: dict) -> str:
    raw = json.dumps(data).encode("utf-8")
    iv = get_random_bytes(16)
    cipher = AES.new(AES_KEY, AES.MODE_CBC, iv)
    encrypted = cipher.encrypt(pad(raw, AES.block_size))
    return base64.b64encode(iv + encrypted).decode("utf-8")

def save_file(content: str):
    folder = filedialog.askdirectory(title="Choose folder to save whitelist.enc")
    if not folder:
        return
    filepath = f"{folder}/whitelist.enc"
    with open(filepath, "w") as f:
        f.write(content)
    messagebox.showinfo(texts[current_lang]["title"], texts[current_lang]["success"].format(path=filepath))

def generate_file():
    data = {
        "allowSubdomains": entry_subdomains.get("1.0", tk.END).strip().splitlines(),
        "allowNoSubdomains": entry_no_subdomains.get("1.0", tk.END).strip().splitlines(),
        "allowExactOnly": entry_exact.get("1.0", tk.END).strip().splitlines(),
    }
    for key in data:
        data[key] = [d.strip() for d in data[key] if d.strip()]
    encrypted_data = encrypt_json(data)
    save_file(encrypted_data)

# ==================== UI FUNCTIONS ====================
def switch_lang():
    global current_lang
    current_lang = "he" if current_lang == "en" else "en"
    update_ui()

def update_ui():
    root.title(texts[current_lang]["title"])
    lbl_title.config(text=texts[current_lang]["title"])

    txt_instructions.config(state="normal")
    txt_instructions.delete("1.0", tk.END)
    txt_instructions.insert("1.0", texts[current_lang]["instructions"])

    txt_instructions.tag_add("highlight", "1.0", "1.end")
    txt_instructions.tag_config("highlight", font=("Segoe UI", 14, "bold"), foreground="darkblue")

    if current_lang == "he":
        txt_instructions.tag_add("rtl", "1.0", "end")
        txt_instructions.tag_config("rtl", justify="right")
    else:
        txt_instructions.tag_add("ltr", "1.0", "end")
        txt_instructions.tag_config("ltr", justify="left")

    txt_instructions.config(state="disabled")

    lbl_subdomains.config(text=texts[current_lang]["subdomains"])
    lbl_no_subdomains.config(text=texts[current_lang]["no_subdomains"])
    lbl_exact.config(text=texts[current_lang]["exact"])
    btn_generate.config(text=texts[current_lang]["generate"])
    btn_lang.config(text=texts[current_lang]["lang_button"])

